import { Component, OnInit } from '@angular/core';
import { User } from 'src/app/models/user.model';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent implements OnInit {
  user: User = new User();
  notLogged = true;
  isAdmin = false;
  isOwner = false;
  isDecorator = false;

  constructor() {}

  ngOnInit(): void {
    this.user = JSON.parse(localStorage.getItem('user') || '{}');
    if (this.user == null) {
      this.notLogged = true;
      this.isAdmin = false;
      this.isOwner = false;
      this.isDecorator = false;
    }
    if (this.user.user_type_id == 3) {
      this.notLogged = false;
      this.isAdmin = true;
      this.isOwner = false;
      this.isDecorator = false;
    }
    else if (this.user.user_type_id == 1) {
      this.notLogged = false;
      this.isAdmin = false;
      this.isOwner = true;
      this.isDecorator = false;
    }
    else if (this.user.user_type_id == 2) {
      this.notLogged = false;
      this.isAdmin = false;
      this.isDecorator = true;
      this.isOwner = false;
    }

  }

  logout() {
    localStorage.removeItem('user');
  }
}
<nav class="navbar navbar-expand-lg navbar-light bg-light">
  <img class="navbar-brand navbar-logo" src="/src/assets/photos/Logo.png" alt="Logo">
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse" id="navbarNav">
    <ul class="navbar-nav">
      <li class="nav-item" *ngIf="notLogged">
        <a class="nav-link" href='/home'>Home</a>
      </li>
      <li class="nav-item" *ngIf="notLogged">
        <a class="nav-link" href='/login'>Login</a>
      </li>
      <li class="nav-item" *ngIf="isAdmin">
        <a class="nav-link" href="#">Admin Dashboard</a>
      </li>
      <li class="nav-item" *ngIf="isOwner">
        <a class="nav-link" href="#">Owner Profile</a>
      </li>
      <li class="nav-item" *ngIf="isDecorator">
        <a class="nav-link" href="#">Decorator Tools</a>
      </li>
      <li class="nav-item" *ngIf="!notLogged">
        <a class="nav-link" href="/home" (click)="logout()">Logout</a>
      </li>
    </ul>
  </div>
</nav>
